  Future<void> testLastSaved() async {
    String resultMessage;
    try {
      final nowTime = DateTime.now();
      await HealthMetricsObservers.updateLastDateSaved(newDateInMilliseconds: nowTime.millisecondsSinceEpoch, metricType: "SLEEP");
      await HealthMetricsObservers.updateLastDateSaved(newDateInMilliseconds: nowTime.subtract(Duration(hours: 6)).millisecondsSinceEpoch, metricType: "STEP");
      final lastSavedStep = await HealthMetricsObservers.getLastDateSaved(metricType: "STEP");
      final lastSavedStepDate = DateTime.fromMillisecondsSinceEpoch(lastSavedStep ?? 0);

      final lastSavedSleep = await HealthMetricsObservers.getLastDateSaved(metricType: "SLEEP");
      final lastSavedSleepDate = DateTime.fromMillisecondsSinceEpoch(lastSavedSleep ?? 0);

      resultMessage = "sleep: $lastSavedSleepDate step: $lastSavedStepDate";
    } catch(exception) {
      resultMessage = 'Failed to create observer.';
    }
    setState(() {
      _message = resultMessage;
    });
  }

  Future<void> testPermissions() async {
    String resultMessage;
    try {
      final permissionsGranted = await requestPermissions();
      if (permissionsGranted) {
        //await HealthMetricsObservers.updateLastDateSaved(DateTime.now().millisecondsSinceEpoch);
        await HealthMetricsObservers.createObserverWithServerSync(
          apiUrl: "https://api.stage.trywecare.com",
          endpoint: "/api/profile/public/metrics",
          userId: Platform.isIOS ? "6738c48a-82a8-4a96-9cdb-4ccfa71e8026" : "d6fed06e-dd7c-410a-8c37-313de6754543",
          userApiKey: Platform.isIOS ? "599a1a53-642e-4b01-9f17-38bcc10d7772" : "22ae171f-97fa-48cf-86af-3e25a2f7df6b",
          xApiKey: "F0mHuKprUe6OCJLIi5u1P1sZWD8TNaDu7scEw9r3",
          metricType: 'STEP',
        );
        resultMessage = "success created observer";
      }else{
        resultMessage = 'permissions not granted.';
      }
    } catch(exception) {
      resultMessage = 'Failed to create observer.';
    }
    setState(() {
      _message = resultMessage;
    });
  }

